import React from "react";
import MapChart from "./MapChart";

import "./Map.css";

const MapPage = ({ setCurrChosen, currChosen, currMap }) => {
  const mapProps = {
    World: {
      scale: 170,
      center: [40, 40],
      rotate: [-10, 0, 0],
      coordinates: [0, 0],
      translateExtent: [
        [-100, -50],
        [860, 600],
      ],
      minZoom: 1,
      maxZoom: 6,
    },
    Europe: {
      scale: 170,
      center: [40, 80],
      rotate: [-10, 0, 0],
      coordinates: [13.5, 50],
      //translateExtent goes:
      //[left, up],
      //[right,down]
      translateExtent: [
        [280, 380],
        [460, 570],
      ],
      minZoom: 4.5,
      maxZoom: 8,
    },
    SouthAmerica: {
      scale: 170,
      center: [40, 40],
      rotate: [-10, 0, 0],
      coordinates: [-60, -20],
      //translateExtent goes:
      //[left, up],
      //[right,down]
      translateExtent: [
        [0, 290],
        [350, 600],
      ],
      minZoom: 2,
      maxZoom: 6,
    },
    NorthAmerica: {
      scale: 170,
      center: [40, 75],
      rotate: [-10, 0, 0],
      coordinates: [-78, 45],
      //translateExtent goes:
      //[left, up],
      //[right,down]
      translateExtent: [
        [-100, 290],
        [300, 615],
      ],
      minZoom: 2,
      maxZoom: 8,
    },
    Africa: {
      scale: 170,
      center: [40, 40],
      rotate: [-10, 0, 0],
      coordinates: [13.5, -20],
      //translateExtent goes:
      //[left, up],
      //[right,down]
      translateExtent: [
        [280, 200],
        [460, 500],
      ],
      minZoom: 2,
      maxZoom: 6,
    },
  };

  return (
    <>
      <div className="map">
        <MapChart
          setCurrChosen={setCurrChosen}
          currChosen={currChosen}
          currMap={currMap}
          mapProps={mapProps[currMap]}
          // currLocation={props.currLocation}
        />
      </div>
    </>
  );
};

export default MapPage;
